import Heading from "../../components/Nav/Nav";
import ConfigForm from "../../components/billForm";

class Config extends Component {
  render() {
    return (
      <React.Fragment>
        <Heading />
        <br />
        <div class="container-fluid">
          <ConfigForm />
        </div>
      </React.Fragment>
    );
  }
}

export default Bill;
